INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'circ.staff_client.do_not_auto_attempt_print', 'ar-JO', 'تعطيل محاولات الطباعة الآلية من واجهات برنامج المحطة الطرفية لطاقم المكتبة من أجل أنواع الاستلام في هذه القائمة. القيم الممكنة: "الإعارة"، "دفع الفاتورة"، "إنزلاق  الحجز"، "إنزلاق النقل"، و "انزلاق الحجز/النقل". وهذا يختلف من مربع خيار الطباعة الآلية في الواجهات ذات الصلة في تلك التي تُعطل محاولات الطباعة الآلية معاً، بدلاً من دعم الطباعة الصامتة عن طريق حظر حوار الطباعة. مربع اختيار الطباعة الآلي في هذه الواجهات ليس لديه أي تأثير على سلوك هذا الإعداد. في حالة الحجز، النقل، وانزلاقات الحجز/النقل، فإنه أيضاً يمنع حوارات التنبيه التي تسبق حوار الطباعة ـ تلك التي تُقدم الطباعة وعدم الطباعة كخيارات ـ .');
