INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'circ.lost.generate_overdue_on_checkin', 'ar-JO', 'تمكين هذا الإعداد سوف يتسبب في إنشاء بأثر رجعي لـِ الغرامات المستحقة غير المتواجدة حتى الآن لـِ النسخ المُرجعة المفقودة، وصولاً إلى لحظة الإرجاع (أو الغرامات القصوى التي تمّ الوصول إليها). وهذا يختلف عن "استرجاع المُستحقات المفقودة"، لأنها تُنشأ فقط الغرامات المُستحقة الجديدة. استخدام كل الإعدادات معاً للحصول على المجموعة الكاملة من الغرامات المُستحقة لـِ النُسخة المفقودة');
