INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'opac.org_unit_hiding.depth', 'ar-JO', 'هذا وسوف يخفي وحدات تنظيمية معينة في الأوباك العام إذا كان الموقع المادي ـ رابط البارامتر  "physical_loc"ـ من أجل إرث الأوباك لهذا الإعداد. يحدد هذا الإعداد عمق الوحدة التنظيمية، والتي جنباً إلى جنب مع الموقع الأوباك المادي تحدد أي قسم تنظيمي لـِ التسلسل الهرمي ينبغي أن يكون مرئياً في الأوباك. على سبيل المثال، فإن تثبيت إيفرغرين لديه 3 مستويات هرمية، ـ اتحاد، نظام، فرع ـ حيث لدى النظام عمق 1 والفرع لديه عمق 2.  إذا احتوى هذا الإعداد على عمق 1 في مثل هذا التثبيت، عندئذٍ كل مكتبة في النظام والتي ينتمي إليها الموقع المادي سوف تكون مرئية، وسوف يكون كل شيء آخر مخفي . أما العمق 0 سوف يجعل كل تنظيم مرئي. والأوباك المتضمن في برنامج المحطة الطرفية لطاقم المكتبة يتجاهل هذا الإعداد.');
